import React, { Component } from "react";
import Plot from "react-plotly.js";

export class ELFPlot extends Component {
  constructor(props) {
    super(props);
    this.spd_test = this.props.test;
    console.log("SPD_Test = ");
    console.log(this.spd_test);
    var i;

    this.wavelength = [];
    for (i = 0; i < 400; i++) {
      this.wavelength[i] = i + 380;
    }

    console.log("Wavelengths = ");
    console.log(this.wavelength);

    this.test = [];
    for (i = 0; i <= 400; i++) {
      //this.test[i] = this.spd_test[i];
    }

    this.trace1 = {
      x: [1, 2, 3, 4],
      y: [10, 15, 13, 17],
      type: "scatter"
    };

    this.trace2 = {
      x: [1, 2, 3, 4],
      y: [16, 5, 11, 9],
      type: "scatter"
    };
  }
  render() {
    return (
      <Plot>
        title={null}
        data=
        {[
          {
            type: "scatter",
            x: this.wavelength,
            y: this.spd_test,
            mode: "lines+points",
            marker: { color: "red" }
          }
        ]}
        layout={{ width: 200, height: 240, title: "A Fancy Plot" }}
      </Plot>
    );
  }
}

export default ELFPlot;
